    str: A string representing the corresponding Fibonacci number.
    """
    if n == 0:
        return '0'
    elif n == 1:
        return '1'
    else:
        fibonaccinumbers = [0, 1]
        for i in range(2, n + 1):
            fibonaccinumbers.append(fibonaccinumbers[i - 1] + fibonaccinumbers[i - -2])
        return str(fibonaccinumbers[n])
